import Post from "./Post/Post";

function MyPosts(props) {
  let postData = [
    {
      id: 1,
      name: "Maria",
    },

    {
      id: 2,
      name: "Anna",
    },

    {
      id: 3,
      name: "Ani",
    },

    {
      id: 4,
      name: "Armen",
    },
    {
      id: 5,
      name: "Artak",
    },
    {
      id: 6,
      name: "Argam",
    },
  ];

  return (
    <div className="postsBlock">
      <h3> My Posts </h3>
      <div>
        <div>
          <textarea></textarea>
        </div>
        <div>
          <button>Add post</button>
        </div>
      </div>
      <div className="posts"></div>
      <Post message="My first post" likesCount=" 15" />
      <Post message="M second post" likesCount=" 20" />
    </div>
  );
}

export default MyPosts;
